import React from "react";
import animedata from './rjs'
export default function Joke() {
  const jokeElements = animedata.map((joke) => {
    return <Joke mc={joke.mc} anime={joke.anime}></Joke>;
  });
  return <h1>{jokeElements}</h1>;
  return (
    <div>
      <h1></h1>
      <h1></h1>
      <hr></hr>
    </div>
  );
}
